import React from "react";


import CatalogueImageController, { Props } from "./CatalogueImageController.web";

export const configJSON = require("./config");

export class CatalogueImage extends CatalogueImageController {
    constructor(props: Props) {
        super(props);
        // Customizable Area Start
        // Customizable Area End
    }
    // Customizable Area Start
    // Customizable Area End
    render() {
        return (
            <>
                <div className="admin-wrapper">
                    {/* Sidebar */}
                    <div
                        className={
                            this.state.menuCollapsed
                                ? "admin-sidebar-collapsed"
                                : "admin-sidebar"
                        }
                    >

                        {/* Admin Body */}
                        <div
                            className={
                                this.state.menuCollapsed ? "admin-body-collapsed" : "admin-body"
                            }
                        >
                            <div className=" bg-off-white p-8">
                                <div className="flex justify-between mb-6">
                                    <div className="flex items-center">
                                        <div className="h-w-36 rounded-lg flex items-center justify-center bg-grey mr-6">
                                            <i className="las la-ellipsis-h" />
                                        </div>
                                        <h2 className="font-20 font-bold">Add Products</h2>
                                    </div>
                                </div>

                                <div className=" p-6 bg-white">
                                    {/* <Tabs color="blue" /> */}
                                    <div className="modal-footer flex justify-between">
                                        <button
                                            type="button"
                                            className="button op-btn-primary w-auto"
                                        >
                                            Add Products
                    </button>
                                        <button
                                            type="button"
                                            className="button okyd-grey-btn"
                                        >
                                            Cancel
                    </button>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </>
        )
    }
}
